<template>
  <button 
    class="reaction"
  >
   <img :src=reactions.icon :alt=reactions.text >
  </button>
</template>

<script>
export default {
  props: {
     reaction: String
  },
  computed: {
    reactions() {
      let text
      let icon
      const HandupIcon="data:image/png;base64,";
      const agreeIcon="data:image/png;base64,";
      const disagreeIcon ="data:image/png;base64,";
      const respondIcon = "data:image/png;base64,";
      const clarifyIcon = "data:image/png;base64,";
      const pooIcon = "data:image/png;base64,";
    const blockIcon="data:image/png;base64,";
  const opposeIcon="data:image/png;base64,";

      switch (this.reaction) {
        case 'Handup':
          icon = HandupIcon
          text = 'I want to speak'
          break;
       case 'Agree':
          icon = agreeIcon
          text = 'I agree'
          break;
       case 'Disagree':
          icon = disagreeIcon
          text = 'I disagree'
          break;

      case 'Respond':
          icon = respondIcon
          text = 'I want to respond'
          break;
      
      case 'Clarify':
          icon = clarifyIcon
          text = 'I need clarification'
          break;

      case 'Point of Order':
          icon = pooIcon
          text = 'I want to Raise a Point of Order'
          break;

      case 'Block':
          icon = blockIcon
          text = 'I block'
          break;

      case 'Oppose':
          icon = opposeIcon
          text = 'I oppose'
          break;
      
        default:
          break;
      }

      return {icon, text}
    } 
  }
}

</script>

<style scoped>
  button {
    appearance: none;
    border: 0;
    background: transparent;
  }

  button:focus {
    background: yellow;
  }
  
  img {
    width: 3em;
    height: 3em;
  }
</style>